import React from "react";
import WriteReviewBox from "./WriteReviewBox";


function WriteReview() {
  return (
    <div>
      <div className="review-background">
        <div className="review-box-container">
          <WriteReviewBox />
        </div>
      </div>
    </div>
  )
}


export default WriteReview;
